func (_c *CDRCreateBulk) OnConflictColumns(columns ...string) *CDRUpsertBulk {
	_c.conflict = append(_c.conflict, sql.ConflictColumns(columns...))
	return &CDRUpsertBulk{
		create: _c,
	}
}

